import React, { useState } from 'react';
import { Visualizations, YearOption, AreaOption, SeverityOption } from '../types';

// Import your SVG files - add declarations to make TypeScript recognize these imports
// You'll need to create a declaration file for this
// We'll use string paths for now and add proper typing later
import crashMapSVG from '../assets/crash_locations_map.svg';
import crashesByHourSVG from '../assets/crashes_by_hour.svg';
import crashHeatmapSVG from '../assets/crash_heatmap_day_hour.svg';
import monthlyFrequencySVG from '../assets/crash_frequency_by_month.svg';
import seasonalFrequencySVG from '../assets/crash_frequency_by_season.svg';

const CrashDashboard: React.FC = () => {
  const [activeTab, setActiveTab] = useState<string>('map');

  // Define visualizations with imported SVGs
  const visualizations: Visualizations = {
    map: {
      title: "Crash Hotspots Map",
      description: "Map visualization showing the most dangerous intersections in San Jose",
      svg: crashMapSVG,
      alt: "Map of crash hotspots in San Jose"
    },
    hourly: {
      title: "Crashes by Hour of Day",
      description: "Distribution of crashes throughout the day showing peak hours",
      svg: crashesByHourSVG,
      alt: "Bar chart showing crashes by hour of day"
    },
    heatmap: {
      title: "Day & Hour Heatmap",
      description: "Heatmap showing crash patterns by day of week and hour of day",
      svg: crashHeatmapSVG,
      alt: "Heatmap of crashes by day and hour"
    },
    monthly: {
      title: "Monthly Crash Trends",
      description: "Crash frequency for each month of the year",
      svg: monthlyFrequencySVG,
      alt: "Line chart showing monthly crash trends"
    },
    seasonal: {
      title: "Seasonal Crash Patterns",
      description: "Distribution of crashes by season",
      svg: seasonalFrequencySVG,
      alt: "Chart showing seasonal crash patterns"
    }
  };

  // Filter options
  const yearOptions: YearOption[] = [2020, 2021, 2022, 2023];
  const areaOptions: AreaOption[] = ['Downtown', 'Eastside', 'North San Jose', 'South San Jose', 'West San Jose'];
  const severityOptions: SeverityOption[] = ['All', 'Fatal', 'Severe', 'Moderate', 'Minor'];

  // State for filters
  const [selectedYear, setSelectedYear] = useState<YearOption>(2023);
  const [selectedArea, setSelectedArea] = useState<AreaOption>('All');
  const [selectedSeverity, setSelectedSeverity] = useState<SeverityOption>('All');

  return (
    <div className="flex flex-col min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-blue-700 text-white p-4 shadow-md">
        <h1 className="text-3xl font-bold">San Jose Crash Data Analysis</h1>
        <p className="text-lg">Interactive visualization of traffic collision patterns</p>
      </header>

      {/* Main Content */}
      <main className="flex-grow p-4 md:p-6">
        {/* Controls Bar */}
        <div className="bg-white p-4 rounded-lg shadow mb-6 flex flex-wrap gap-4 items-center">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Year</label>
            <select 
              className="border rounded p-2 bg-white"
              value={selectedYear}
              onChange={(e) => setSelectedYear(Number(e.target.value) as YearOption)}
            >
              {yearOptions.map(year => (
                <option key={year} value={year}>{year}</option>
              ))}
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Area</label>
            <select 
              className="border rounded p-2 bg-white"
              value={selectedArea}
              onChange={(e) => setSelectedArea(e.target.value as AreaOption)}
            >
              <option value="All">All Areas</option>
              {areaOptions.map(area => (
                <option key={area} value={area}>{area}</option>
              ))}
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Severity</label>
            <select 
              className="border rounded p-2 bg-white"
              value={selectedSeverity}
              onChange={(e) => setSelectedSeverity(e.target.value as SeverityOption)}
            >
              {severityOptions.map(severity => (
                <option key={severity} value={severity}>{severity}</option>
              ))}
            </select>
          </div>
        </div>

        {/* Tabs */}
        <div className="mb-6">
          <div className="border-b border-gray-200">
            <nav className="flex flex-wrap -mb-px">
              {Object.keys(visualizations).map(key => (
                <button
                  key={key}
                  className={`py-2 px-4 text-center border-b-2 font-medium text-sm ${
                    activeTab === key
                      ? 'border-blue-500 text-blue-600'
                      : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                  }`}
                  onClick={() => setActiveTab(key)}
                >
                  {visualizations[key].title}
                </button>
              ))}
            </nav>
          </div>
        </div>

        {/* Visualization Content */}
        <div className="bg-white p-4 rounded-lg shadow mb-6">
          <h2 className="text-xl font-bold mb-2">{visualizations[activeTab].title}</h2>
          <p className="text-gray-600 mb-4">{visualizations[activeTab].description}</p>

          {/* Display the filter selections */}
          <div className="mb-4 text-sm text-gray-600">
            Showing data for {selectedYear}, {selectedArea === 'All' ? 'All Areas' : selectedArea}, 
            {selectedSeverity === 'All' ? ' All Severity Levels' : ` ${selectedSeverity} Crashes`}
          </div>

          {/* SVG Visualization Container */}
          <div className="border border-gray-200 rounded-lg p-4 flex justify-center bg-gray-50">
            <img 
              src={visualizations[activeTab].svg} 
              alt={visualizations[activeTab].alt}
              className="max-w-full max-h-[600px] object-contain"
            />
          </div>
        </div>

        {/* Insights Panel */}
        <div className="bg-white p-4 rounded-lg shadow">
          <h3 className="text-lg font-bold mb-2">Key Insights</h3>
          <ul className="list-disc pl-5 space-y-2 text-gray-700">
            <li>Crash frequency peaks during evening rush hour (5-6 PM)</li>
            <li>Monterey Road & Curtner Avenue is the most dangerous intersection</li>
            <li>Fall months have the highest number of crashes</li>
            <li>Friday evenings show significantly more crashes than other weekday evenings</li>
            <li>Weather conditions play a significant role in crash frequency</li>
          </ul>
        </div>
      </main>

      {/* Footer */}
      <footer className="bg-gray-800 text-white p-4 text-center">
        <p>San Jose Crash Data Analysis Dashboard © 2025</p>
        <p className="text-sm text-gray-400">Built with React • Data from San Jose Data Portal</p>
      </footer>
    </div>
  );
};

export default CrashDashboard;
